Os traemos uno de esos cara a cara que tanto nos gustan a todos. En una esquina tenemos a Natalia Zeta, con sus impresionantes curvas, siempre desprendiendo un morbo que nos vuelve locos. En la otra tenemos a otro Zeta, en este caso a nuestro Juan Z. ?Quien saldra victorioso? os podemos adelantar que no sabemos quien va a ganar, pero si sabemos como va a terminar la cara de la femina: totalmente blanca.
